import React from "react";
import imageUrl from "../assets/images/Banner/Banner.webp";
import Banner from "../components/Home/Banner/Banner";
import classes from "../styles/About.module.css";


const About = () => (
    <div>
        <Banner image={imageUrl} title="" />
        <div className={classes.style}>ABOUT</div> <br />
        ABOUT <br />
        ABOUT <br />
        ABOUT <br />
        ABOUT <br />
    </div>
);

export default About;
